import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./index.css";
import Series from "./Series";

ReactDOM.render(
  <>
    <h1>NETFLIX BEST SERIES IN 2022</h1>,
    {Series.map(App)}
  </>,
  document.getElementById("root"));
